import React, { useState } from "react"
import API from "../../utils/API"
import Form from "react-bootstrap/"

function PtInitForm(props) {
    const [ptInit, setPtInit] = useState({
        respondingUnit: "",
        ETA: "",
        criticalWarn: ""
    })
    const [ptId, setPtId] = useState("")

    function handleInputChange(event) {
        // console.log(event.target.name)
        const { name, value } = event.target
        setPtInit({ ...ptInit, [name]: value })
    }

    function handleSubmit(event) {
        event.preventDefault()
        // console.log(ptInit)
        API.createPatient(ptInit).then((data) => {console.log(data)})
            // .then(API.findMostRecentPatient()
            //     .then(setPtId()))
        // .then(console.log(dbModel)))

    }

    return (
        <Form onSubmit={handleSubmit}>
            <Form.Label >
                Unit Responding
                <Form.Control
                    onChange={handleInputChange}
                    type="text"
                    name="respondingUnit"
                />
            </Form.Label>
            <Form.Label>
                ETA
                <Form.Control
                    type="text"
                    name="ETA"
                    onChange={handleInputChange}
                />
            </Form.Label>
            <Form.Label>
                Critical Warnings
                <Form.Control
                    type="text"
                    name="criticalWarn"
                    onChange={handleInputChange} />
            </Form.Label>
            <Form.Control type="submit" value="Submit"></Form.Control>
            {/* <button 
            className="btn btn-warning"
            >
                <h4>Open New Incident
                </h4>
            </button> */}
        </Form>
    )
}

export default PtInitForm
